import React, { useState } from 'react';
import {
  Box,
  Typography,
  Grid,
  Card,
  CardContent,
  Slider,
  FormControlLabel,
  Checkbox,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper
} from '@mui/material';

interface Video {
  title: string;
  publishedAt: string;
  url: string;
  thumbnail: string;
  statistics: {
    viewCount: string;
    likeCount: string;
    commentCount: string;
  };
}

interface ProductSelectionProps {
  videos: Video[];
  onProductSelect: (selection: any) => void;
}

const packages = [
  { name: 'BASIC 패키지', price: 100000 },
  { name: 'STANDARD 패키지', price: 200000 },
  { name: 'PREMIUM 패키지', price: 300000 },
  { name: 'VIP 패키지', price: 500000 }
];

export const ProductSelection: React.FC<ProductSelectionProps> = ({ videos = [], onProductSelect }) => {
  const [selectedVideos, setSelectedVideos] = useState<{[key: string]: boolean}>({});
  const [subscriberCount, setSubscriberCount] = useState<number>(0);
  const [metrics, setMetrics] = useState<{[key: string]: {
    views: number;
    likes: number;
    comments: number;
  }}>({});

  const handleVideoSelect = (videoUrl: string) => {
    setSelectedVideos(prev => ({
      ...prev,
      [videoUrl]: !prev[videoUrl]
    }));
  };

  const handleMetricChange = (videoUrl: string, metric: string, value: number) => {
    setMetrics(prev => ({
      ...prev,
      [videoUrl]: {
        ...prev[videoUrl],
        [metric]: value
      }
    }));
  };

  const calculateTotal = () => {
    let total = subscriberCount * 1000; // 구독자 수 * 단가

    Object.entries(selectedVideos).forEach(([url, isSelected]) => {
      if (isSelected && metrics[url]) {
        const videoMetrics = metrics[url];
        total += (videoMetrics.views * 100) + 
                (videoMetrics.likes * 200) + 
                (videoMetrics.comments * 500);
      }
    });

    return total;
  };

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h5" gutterBottom>
        1. 구독자 늘리기
      </Typography>
      <Grid container spacing={2} sx={{ mb: 4 }}>
        {packages.map((pkg) => (
          <Grid item xs={3} key={pkg.name}>
            <Card>
              <CardContent>
                <Typography variant="h6">{pkg.name}</Typography>
                <Typography>₩{pkg.price.toLocaleString()}</Typography>
                <FormControlLabel
                  control={
                    <Checkbox
                      onChange={(e) => setSubscriberCount(e.target.checked ? pkg.price : 0)}
                    />
                  }
                  label="선택"
                />
              </CardContent>
            </Card>
          </Grid>
        ))}
      </Grid>

      <Typography variant="h5" gutterBottom>
        2. 게시물 지표 늘리기
      </Typography>
      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>선택</TableCell>
              <TableCell>영상 제목</TableCell>
              <TableCell>업로드 일자</TableCell>
              <TableCell>조회수</TableCell>
              <TableCell>좋아요</TableCell>
              <TableCell>댓글</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {videos.map((video) => (
              <TableRow key={video.url}>
                <TableCell>
                  <Checkbox
                    checked={selectedVideos[video.url] || false}
                    onChange={() => handleVideoSelect(video.url)}
                  />
                </TableCell>
                <TableCell>{video.title}</TableCell>
                <TableCell>{video.publishedAt}</TableCell>
                <TableCell>
                  <Slider
                    disabled={!selectedVideos[video.url]}
                    min={0}
                    max={10000}
                    step={100}
                    valueLabelDisplay="auto"
                    onChange={(_, value) => 
                      handleMetricChange(video.url, 'views', value as number)
                    }
                  />
                </TableCell>
                <TableCell>
                  <Slider
                    disabled={!selectedVideos[video.url]}
                    min={0}
                    max={1000}
                    step={10}
                    valueLabelDisplay="auto"
                    onChange={(_, value) => 
                      handleMetricChange(video.url, 'likes', value as number)
                    }
                  />
                </TableCell>
                <TableCell>
                  <Slider
                    disabled={!selectedVideos[video.url]}
                    min={0}
                    max={100}
                    step={1}
                    valueLabelDisplay="auto"
                    onChange={(_, value) => 
                      handleMetricChange(video.url, 'comments', value as number)
                    }
                  />
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      <Box sx={{ mt: 4, p: 2, bgcolor: 'background.paper' }}>
        <Typography variant="h6" gutterBottom>
          견적서
        </Typography>
        <Typography>
          총 견적: ₩{calculateTotal().toLocaleString()}
        </Typography>
      </Box>
    </Box>
  );
};
